import React from 'react';
import { Routes, Route, Router } from 'react-router-dom';
import './App.css';
import Home from './screens/Home'; 
import Charts from './screens/Charts';

const App = () => {
  return (
    <>
      <div>
        <Router>
          <Route path='/Home' element={<Home/>} />
          <Route path='/Charts' element={<Charts/>} />
        </Router>
      </div>
    </>
  );
}


export default App;
